import React,{Component} from "react";
import './product_list';
import '../scss_files/product_list_style.scss';

 class RecordList extends Component {
    render() {
        return (
            <div className = 'box'>
            <tr>
                <td style >{this.props.obj.d_sku}</td>
               
                <td>{this.props.obj.d_name}</td>
                
                <td>{this.props.obj.d_price}</td>
                
                <td>{this.props.obj.d_attribute}</td>
            </tr>
            </div>
        );
    }
}

export default RecordList;
